import React from "react";
import { withStyles } from "@material-ui/core/styles";
import clsx from "clsx";
import {
  Card,
  CardHeader,
  CardMedia,
  CardContent,
  CardActions,
  Avatar,
  IconButton,
  Typography
} from "@material-ui/core";
import FavoriteIcon from "@material-ui/icons/Favorite";
import CardTravelIcon from "@material-ui/icons/CardTravel";

const useStyles = theme => ({
  card: {
    maxWidth: 400
  },
  media: {
    height: 0,
    paddingTop: "56.25%" // 16:9
  }
});

const classes = withStyles();

class Cards extends React.Component {
  state = {
    trip: { description: "111" }
  };

  componentWillReceiveProps(props) {
    console.log("this.state.trip", this.state.trip);
    this.setState({ trip: this.props.trip });
  }
  render() {
    const { classes } = this.props;
    return (
      <Card className={classes.card}>
        <CardHeader
          avatar={
            <Avatar
              alt="Remy Sharp"
              src="https://avatars2.githubusercontent.com/u/11773475?s=460&v=4"
              className={classes.bigAvatar}
            />
          }
          action={<IconButton aria-label="settings"></IconButton>}
          title="Looking to go Krabi for a week, maybe WA.. "
          subheader="Dec 18, 2019"
        />
        <CardMedia
          className={classes.media}
          image="https://homeiswhereyourbagis.com/wp-content/uploads/2019/03/artikelbild-chicken-island-tub-island-krabi.jpg"
          title="Paella dish"
        />
        <CardContent>
          <Typography variant="body2" color="textSecondary" component="p">
            {this.state.trip.description}
          </Typography>
        </CardContent>
        <CardActions disableSpacing>
          <IconButton aria-label="add to favorites">
            <FavoriteIcon />
            <Typography>Interested</Typography>
          </IconButton>
          <IconButton aria-label="share">
            <CardTravelIcon />
            <Typography>Trip Details</Typography>
          </IconButton>
        </CardActions>
      </Card>
    );
  }
}
export default withStyles(useStyles)(Cards);
